import { useNavigate } from "react-router-dom";
import { BookOpen, Briefcase, Code, Mic, BarChart } from "lucide-react";

const StudentDashboard = () => {
  const navigate = useNavigate();

  const modules = [
    {
      name: "College Exam Prep",
      desc: "AI summaries, previous year questions, mock tests.",
      icon: <BookOpen className="w-10 h-10 text-green-600" />,
      path: "/exam-prep",
      color: "from-green-200 to-green-400",
    },
    {
      name: "Placement Prep",
      desc: "DBMS, OS, CN, DSA, aptitude and resume analyzer.",
      icon: <Briefcase className="w-10 h-10 text-blue-600" />,
      path: "/placement-prep",
      color: "from-blue-200 to-blue-400",
    },
    {
      name: "Coding & SQL Practice",
      desc: "Solve DSA sheets and SQL problems with AI hints.",
      icon: <Code className="w-10 h-10 text-purple-600" />,
      path: "/coding-practice",
      color: "from-purple-200 to-purple-400",
    },
    {
      name: "AI Interview Assistant",
      desc: "Mock interviews with AI feedback and scoring.",
      icon: <Mic className="w-10 h-10 text-pink-600" />,
      path: "/ai-interview",
      color: "from-pink-200 to-pink-400",
    },
    {
      name: "Progress & Analytics",
      desc: "Track progress, badges, and leaderboard.",
      icon: <BarChart className="w-10 h-10 text-yellow-600" />,
      path: "/progress",
      color: "from-yellow-200 to-yellow-400",
    },
  ];

  return (
    <div className="min-h-screen bg-gray-50 pt-24 px-8">
      <h1 className="text-4xl font-bold text-center text-green-700 mb-10">
        Student Dashboard
      </h1>

      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8 max-w-6xl mx-auto">
        {modules.map((module) => (
          <div
            key={module.name}
            onClick={() => navigate(module.path)}
            className={`bg-gradient-to-br ${module.color} p-6 rounded-3xl shadow-md hover:shadow-xl hover:scale-105 transition-transform cursor-pointer`}
          >
            <div className="flex items-center space-x-4 mb-4">
              <div className="bg-white p-3 rounded-full shadow-inner">
                {module.icon}
              </div>
              <h2 className="text-xl font-semibold text-gray-800">
                {module.name}
              </h2>
            </div>
            <p className="text-gray-700">{module.desc}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default StudentDashboard;
